pragma solidity ^0.8.10;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/StringsUpgradeable.sol";

contract Story is OwnableUpgradeable {
    // string private storedData;
    // address[] private transactionHistoryAddresses;
    // string[] private transactionHistoryPhrases;
    uint256 private numNarratives;
    mapping(uint256 => Narrative) private narratives;

    struct Narrative {
        string title;
        string narrative;
        address[] transactionHistoryAddresses;
        string[] transactionHistoryPhrases;
    }

    function initialize() public initializer {
        __Ownable_init();
        numNarratives = 1;
        Narrative storage nar = narratives[numNarratives];
        nar.title = "The";
    }

    function validateWord(string memory word) private pure {
        require(bytes(word).length > 0);
        require(bytes(word).length <= 42);
    }

    function getNarrativeTitles() public view returns (string[2][] memory) {
        string[2][] memory titles = new string[2][](numNarratives);
        for (uint256 i = 0; i < numNarratives; i++) {
            titles[i][0] = StringsUpgradeable.toString(i);
            titles[i][1] = narratives[i + 1].title;
        }
        return titles;
    }

    function getNumNarratives() public view returns (uint256) {
        return numNarratives;
    }

    function newNarrative(string memory word) public payable {
        validateWord(word);
        require(
            msg.value == 0.1 ether,
            "You must provide 0.1 ether to create a new story"
        );
        numNarratives += 1;
        Narrative storage nar = narratives[numNarratives];
        nar.title = word;
    }

    function deposit() public payable {}

    function getBalance() public view onlyOwner returns (uint256) {
        return address(this).balance;
    }

    function ownerWithdraw() public onlyOwner {
        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "ownerWithdraw failed");
    }

    function addWord(string memory word) public payable {
        require(
            bytes(word).length > 0 && bytes(word).length <= 42,
            "word must be between 1 than 42 characters, inclusive"
        );
        require(
            msg.value == 0.01 ether,
            "You must provide 0.01 ether to add a word"
        );

